import styled from "styled-components";
import { ImageContainer, RowSpaceBetween, SpaceHolder } from "../styled";
//@ts-ignore
import Logo from "../assets/images/logo.png";
import Search from "../assets/sv/logo.png";

const Header = () => {
    return (  <HeaderWrapper>
        <ImageContainer width="50px" height="50px" src={Logo}/>
        <SearchBarBody>
        <ImageContainer width="50px" height="50px" src={Logo}/>

        </SearchBarBody>
        <SpaceHolder width="50px" height="50px"/>
    </HeaderWrapper>);
}

export default Header;
const HeaderWrapper = styled(RowSpaceBetween)`
max-height: 80px;
min-height: 80px;
border-bottom: 1px solid rgba(180, 180, 180, 1);
width: 100vw;
height: 100%;
`;

export const SearchBarBody = styled(RowSpaceBetween)`
width: 100%;
max-width: 598px;
height: 40px;
border-radius: 8px;
border: 1px solid rgba(180, 180, 180, 1);
background: rgba(245, 245, 245, 1);

`
